import React from "react";
import { Link } from "react-router-dom";

export default class Nav extends React.Component {
  constructor() {
    super()
    this.state = {
    };
  }



  render() {

    return (
      <nav className="navbar navbar-default fixedtop2" >         
          <div >
            <ul className="nav navbar-nav">

              <li>
                <Link>Dashboard</Link>
              </li>
              <li>
                <Link >Permissions</Link>
              </li>
            </ul>
          </div>
      </nav>
    );
  }
}
